import React from 'react'

const OperationLog = ({ operationLog }) => {
    return(
        <tr>
            <tbody>{operationLog.description}</tbody>
            <tbody>{operationLog.operatedAt}</tbody>
        </tr>
    )
}

export default OperationLog
